document.getElementById("gridSize").oninput = function() {
  document.getElementById("walkIcon").innerHTML = ""
  document.getElementById("walkerPath").setAttribute("d","");
  document.getElementById("walkerMove").setAttribute("path","");
  var gridSize = document.getElementById("gridSize").value;
  var interval = 400/(gridSize*2);
  document.getElementById("gridSizeText").innerHTML = gridSize;
  var x = interval;
  var vGrid = `M ${x.toFixed(1)} -50`;
  while (x < 400){
      x += interval;
      vGrid += ` V 450 M ${x.toFixed(1)} -50`;
  }
  document.getElementById("vGrid").setAttribute("d", vGrid);
  var y = interval;
  var hGrid = `M -50 ${y.toFixed(1)}`;
  while (y < 400){
      y += interval;
      hGrid += ` H 450 M -50 ${y.toFixed(1)}`;
  }
  document.getElementById("hGrid").setAttribute("d", hGrid);
};

var speed = 0.5;
document.getElementById("speed").oninput = function() {
    var speedTime = document.getElementById("speed").value;
    speed = (speedTime/100).toFixed(2)
    document.getElementById("speedText").innerHTML = (speedTime/100).toFixed(2);
}

// IMPORTANT
// https://css-tricks.com/guide-svg-animations-smil/
// IMPORTANT
document.getElementById("startWalk").addEventListener("click", function(){
    var length = parseInt(document.getElementById("vGrid").getAttribute("d").slice(0,10).split(" ")[1]);
    var x=200, y=200;
    var pathSoFar = "M 200 200";
    var pointPath = "M 0 0";
    var count = 0;
    while (!(x <= 5 || x >= 395 || y <= 5 || y >= 395)){
        var directionNum = Math.random(), direction = "";
        if (directionNum < 0.25){direction = "V"; y -= length; pointPath += ` v -${length}`;}
        else if (directionNum < 0.5){direction = "V"; y += length; pointPath += ` v ${length}`;}
        else if (directionNum < 0.75){direction = "H"; x += length; pointPath += ` h ${length}`;}
        else{direction = "H"; x -= length; pointPath += ` h -${length}`;}

        if (direction == "V"){var addCoord = y;}
        else if (direction == "H"){var addCoord = x;}

        pathSoFar += ` ${direction} ${addCoord}`;
        count += 1
        }

    var path = document.getElementById("walkerPath");
    path.setAttribute("d", pathSoFar);
    var pathL = path.getTotalLength();
    path.style.transition = path.style.WebkitTransition = 'none';
    path.style.strokeDasharray = `${pathL.toFixed(2)} ${pathL.toFixed(2)}`;
    path.style.strokeDashoffset = `${pathL.toFixed(2)}`;
    path.getBoundingClientRect();
    path.style.transition = path.style.WebkitTransition =
    `stroke-dashoffset ${(speed*count).toFixed(2)}s linear`;
    path.style.strokeDashoffset = '0';

    var walker = document.getElementById("animateHere");
    // walker.setAttribute("path", `${pointPath}`)
    walker.innerHTML = `<animateMotion id="walkerMove" xlink:href="#walker" dur="${(speed*count).toFixed(2)}s" repeatCount="1" fill="freeze" path="${pointPath}"/>`
    // walker.getBoundingClientRect();

    document.getElementById("pathLength").innerHTML = `The path is ${count} steps long ... `;
    if (count == 42){document.getElementById("pathLength").innerHTML += "you feel Prof Dodds's presence somewhere on this page..."}
    document.getElementById("walkerMove").beginElement()
});

